%[text] # Analyzing Heart Rate Variability Using Time and Frequency Domain Parameters
%[text] This example demonstrates how to get the Heart rate Variability and uses it to get some statistics like mean minimum and maximum, standard deviation. The workflow includes acquiring ECG data, identifying heartbeats using peak detection and some statistical functions. 
%[text] The data used in this example can be acquired from a wearable device such as a BITalino board and should be provided in a supported file format described in the Data description section. While this example does not include code for acquiring ECG data directly from [BITalino](https://www.pluxbiosignals.com/collections/bitalino?srsltid=AfmBOorALQY6SNKViG8JypRobeGXwezf108ouDzG5tW3Qt316vIDQaYb), you can refer to the [Getting Started with BITalino guide](https://www.mathworks.com/matlabcentral/fileexchange/136004-matlab-support-for-bitalino-biosignal-devices) for instructions on data acquisition and device setup.
%[text] This example does require an additional Add-On beyond MATLAB, this being the Signal Processing Toolbox and is intended to work with raw ECG data for seamless analysis and visualization.
%%
%[text] ## Data Description
%[text] This example works with ECG recordings stored as plain text, csv or data files containing a single column of sampled voltage values. The signal represents a single lead ECG waveform, such as those captured using wearable sensors like the BITalino board or similar acquisition systems.
%[text] It is also possible to use more complex datafiles using the *readtable* function to extract the column of interest. The sample data used in this example can be recorded by the user or obtained from publicly available datasets, as long as it is formatted accordingly.
%%
%[text] ## Download Data
%[text] The first step is to acquire an ECG recording to use as input for the analysis. As mentioned before, this example supports data collected from a BITalino device or publicly available ECG datasets such as those provided by [PhysioNet](https://physionet.org/).
%[text] This example uses a collection of [datasets](https://github.com/mathworks/physionet_ECG_data/). Being these datasets from[ MIT-BIH Arrhythmia Database](https://www.physionet.org/content/mitdb/1.0.0/), [MIT-BIH Normal Sinus Rhythm Database](https://www.physionet.org/content/nsrdb/1.0.0/) and [BIDMC Congestive Heart Failure Database](https://www.physionet.org/content/chfdb/1.0.0/).
%[text] The filename and sampling rate can be specified when running the example. If not specified, the sampling rate defaults to 128 Hz since this is the sampling rate of the example shown.
%[text] If you download data from PhysioNet, follow the sourceâ€™s guidelines for data citation and usage. Some datasets may include additional metadata or annotations; however, for this example, only the raw ECG signal is required. Because of that, to use those data *readtable* has to be used selecting the column of interest.
%%
%[text] ## Load File 
%[text] If chosen a sample from PhysioNet you can unzip and load them using the following commands.
% Check if the ECGData.mat file exists, if not download it
if ~exist("ECGData.mat", 'file')
    url = 'https://github.com/mathworks/physionet_ECG_data/archive/refs/heads/main.zip';
    unzip(url);
    unzip("physionet_ECG_data-main\ECGData.zip");
end

% Load the ECG data into the workspace
load("ECGData.mat")
%[text] Each ECG time series from this example has a total duration of 512 seconds.The `ECGData` is a structure array with two fields: `Data` and `Labels`. `Data` is a 162-by-65536 matrix where there are 162 rows, each row is a different patient data and the 65536 lines is the ecg voltage in time aquired, each of these ECG recordings is sampled at 128 Hz. `Labels` is a 162-by-1 cell array of diagnostic labels, one for each row of `Data`. The three diagnostic categories are: `'ARR'` (arrhythmia), `'CHF'` (congestive heart failure), and `'NSR'` (normal sinus rhythm).
signal = ECGData.Data(110,:); %[control:editfield:836c]{"position":[23,26]}
%%
%[text] ## Detecting the R peaks using a bandpass filter and *findpeaks* function
%[text] Using the bandpass filter with frequencies between 3 and 45 Hz followed by the *findpeaks* function we can get the R peaks.
samplingRate = 128; % Hz
signalLength = length(signal);
ts = (0:signalLength-1)' / samplingRate; % secconds
titleFontSize = 16;
labelFontSize = 14;
legendFontSize = 12;

% Preprocess the ECG signal
smoothedSignal = smoothdata(signal,'movmean',5);
[b, a] = butter(4,[3, 45]/(samplingRate/2),'bandpass');
filtered = filtfilt(b, a, smoothedSignal);

% Detect the R-peaks
[pks, rpeaks] = findpeaks(filtered, ...
    'MinPeakHeight', 0.5 * max(filtered), ...
    'MinPeakDistance', 0.6 * samplingRate);
%%
%[text] ## Time Domain Parameters
%[text] Using the data we got, we can now calculate the intervals between two peaks and get the normal to normal intervals (NNI) mean, minimum and maximum, the standard derivation of sucessives NN intervals (SDNN), the mean of SDNN values (SDNN\_index),  . Standard Deviation of the Mean NN intervals of 5min segments (SDANN), Root Mean Square of the Successive NN Interval Differences (RMSSD), Number of NN interval differences greater 50ms (NN50), Ratio between NN50 and total number of NN intervals (pNN50), Triangular Index (TI).
rrIntervals = diff(rpeaks) / samplingRate;
nniMean = mean(rrIntervals) * 1000;

% heart rate in Bpm
hr = 60 ./ rrIntervals; 

% minimum, maximum and mean heart rate
hrMin = min(hr);

hrMax = max(hr);

hrMean = mean(hr);

% Standard Deviation of normal-to-normal intervals
sdnn = std(rrIntervals * 1000);

% Compute RR intervals and their timestamps
rrTimes = rpeaks(2:end) / samplingRate;

% Convert RR to ms
nni = rrIntervals * 1000;

% Initialize list of SDs
segmentSdnn = [];

startTime = rrTimes(1);
endTime = rrTimes(end);

% Duration of each segment in seconds
segmentDuration = 300;

% number of segments
numSegments = floor((endTime - startTime) / segmentDuration);

 

for loopCount = 1:numSegments
    segStart = startTime + (loopCount - 1) * segmentDuration;
    segEnd = segStart + segmentDuration;

    % Get normal-to-normal intervals values within this time window
    inSegment = rrTimes >= segStart & rrTimes < segEnd;
    segmentNni = nni(inSegment);

    if length(segmentNni) > 1

        segmentSdnn(end + 1) = std(segmentNni);

    end

end

sdnnIndex = mean(segmentSdnn);


% Standard Deviation of the Average normal-to-normal intervals, SDANN
segmentMeans = [];
loopCount = 1;

while startTime + (loopCount - 1) * 300 < endTime
    segStart = startTime + (loopCount - 1) * 300;
    segEnd = segStart + 300;

    % Get normal-to-normal intervals values within this time window
    inSegment = rrTimes >= segStart & rrTimes < segEnd;
    segmentNni = nni(inSegment);

   if length(segmentNni) > 1
        segmentMeans(end+1) = mean(segmentNni);
    end

    loopCount = loopCount + 1;
end

% SDANN: standard deviation of the mean NNIs from each segment
sdann = std(segmentMeans);

% Root Mean Square of Successive Differences, RMSSD
% Compute successive differences
diffNni = diff(nni);

% Square of differences
sqDiff = diffNni .^ 2;

% Root mean square
rmssd = sqrt(mean(sqDiff));

% Number of Successive NN Intervals Differing by More Than 50 ms, NN50
nn50 = sum(abs(diff(diff(rpeaks / samplingRate) * 1000)) > 50);

% Percentage of NN50, pNN50 
% Compute absolute differences between successive NNIs
diffNni = abs(diff(nni));
% pNN50 
pnn50 = (nn50 / length(diffNni)) * 100;

% Triangular Index
% Compute histogram
edges = min(nni):8:max(nni) + 8;
counts = histcounts(nni, edges);
% Triangular Index
ti = length(nni) / max(counts);

% Triangular Interpolation of NN Interval Histogram, TINN
% Approximate TINN by fitting a triangle: Find left and right base
[~, maxIdx] = max(counts);

% Go left from the peak to where count drops to near-zero
leftIdx = maxIdx;
while leftIdx > 1 && counts(leftIdx) > 0
    leftIdx = leftIdx - 1;
end

% Go right from the peak to where count drops to near-zero
rightIdx = maxIdx;
while rightIdx < length(counts) && counts(rightIdx) > 0
    rightIdx = rightIdx + 1;
end

% Calculate base width
if leftIdx < rightIdx
    tinn = (edges(rightIdx + 1) - edges(leftIdx));
end

hrvTable = table( ...
    nniMean, ...
    hrMin, ...
    hrMax, ...
    hrMean, ...
    sdnn, ...
    sdnnIndex, ...
    sdann, ...
    rmssd, ...
    nn50, ...
    pnn50, ...
    ti, ...
    tinn, ...
    'VariableNames', { ...
        'Mean NNI (ms)', ...
        'Min RR (ms)', ...
        'Max RR (ms)', ...
        'Mean HR (BPM)', ...
        'SDNN (ms)', ...
        'SDNN Index', ...
        'SDANN (ms)', ...
        'RMSSD (ms)', ...
        'NN50', ...
        'pNN50 (%)', ...
        'Triangular Index', ...
        'TINN (ms)' ...
    });
part = round(width(hrvTable) / 2);
hrvTable1 = hrvTable(:, 1:part);
hrvTable2 = hrvTable(:, part + 1:end);
disp(hrvTable1); %[output:65606f60]
disp(hrvTable2); %[output:52c23d07]
% Plot with mean nni ...

rpeakTimes = rpeaks / samplingRate; 

figure; %[output:868058b9]
plot(rpeakTimes(2:end), rrIntervals*1000, 'b-o', 'LineWidth', 1.2, 'MarkerSize', 4);  %[output:868058b9]
hold on; %[output:868058b9]

% Reference lines
yline(nniMean, 'r--', 'LineWidth', 1.5, 'Label', 'Mean NNI'); %[output:868058b9]
yline(min(rrIntervals) * 1000, '--', 'color', [0 0.4 0], 'LineWidth', 1.5, 'Label', 'Min RR'); %[output:868058b9]
yline(max(rrIntervals) * 1000, 'm--', 'LineWidth', 1.5, 'Label', 'Max RR'); %[output:868058b9]

xlabel('Time (s)', 'FontSize', 14); %[output:868058b9]
ylabel('RR Interval (ms)', 'FontSize', 14); %[output:868058b9]
title(sprintf('RR Intervals with Mean HR = %.2f BPM', hrMean), 'FontSize', 16); %[output:868058b9]
legend('RR Intervals', 'Mean NNI', 'Min RR', 'Max RR', 'FontSize', 12); %[output:868058b9]
grid on; %[output:868058b9]
%%
%[text] ## Frequency Domain Parameters
%[text] 
% Interpolate RR intervals at 4 Hz for frequency analysis
fsInterp = 4; % Hz
tsUniform = rrTimes(1) : 1 / fsInterp : rrTimes(end);
rrInterp = interp1(rrTimes, rrIntervals, tsUniform, 'pchip');

% Detrend and clean the interpolated signal
rrInterp = rrInterp - mean(rrInterp);
rrInterp(isnan(rrInterp)) = [];

% Detrend and clean the interpolated signal
rrInterp = rrInterp - mean(rrInterp);
rrInterp(isnan(rrInterp)) = [];

% Compute Power Spectral Density using Welch's method
[Pxx, f] = pwelch(rrInterp, [], [], [], fsInterp);
df = f(2) - f(1);

% Extract the VLF band (0.003 to 0.040 Hz)
vlfBand = (f >= 0.003 & f <= 0.040);
vlfFreqs = f(vlfBand);
vlfPower = Pxx(vlfBand);

% Find peak frequency within the VLF band
[~, maxIndex] = max(vlfPower);
vlfPeakFrequency = vlfFreqs(maxIndex);

% Low frequency filter
lfBand = (f >= 0.040 & f <= 0.150);
lfFreqs = f(lfBand);
lfPower = Pxx(lfBand);

% Find peak frequency within the LF band
[~, maxIndexLF] = max(lfPower);
lfPeakFrequency = lfFreqs(maxIndexLF);

% High frequency filter 
hfBand = (f >= 0.150 & f <= 0.400);
hfFreqs = f(hfBand);
hfPower = Pxx(hfBand);

% Find peak frequency within the HF band
[~, maxIndexHF] = max(hfPower);
hfPeakFrequency = hfFreqs(maxIndexHF);

% Absolute powers
vlfAbsPower = sum(vlfPower) * df;
lfAbsPower = sum(lfPower) * df;
hfAbsPower = sum(hfPower) * df;

% Logarithmic Power
logVLF = log(vlfAbsPower);
logLF = log(lfAbsPower);
logHF = log(hfAbsPower);

% Total Power
totalPower = vlfAbsPower + lfAbsPower + hfAbsPower;

% LF/HF Ratio
lfHfRatio = lfAbsPower / hfAbsPower;

% Relative Power
vlfRelPower = (vlfAbsPower / totalPower) * 100;
lfRelPower = (lfAbsPower / totalPower) * 100;
hfRelPower = (hfAbsPower / totalPower) * 100;

% Normalized LF and HF Powers
lfHfSum = lfAbsPower + hfAbsPower;

lfNormalized = (lfAbsPower / lfHfSum) * 100;
hfNormalized = (hfAbsPower / lfHfSum) * 100;

% Table with all frequency-domain Parameters
freqHRVTable = table( ...
    vlfPeakFrequency, ...
    lfPeakFrequency, ...
    hfPeakFrequency, ...
    vlfAbsPower, ...
    lfAbsPower, ...
    hfAbsPower, ...
    logVLF, ...
    logLF, ...
    logHF, ...
    lfHfRatio, ...
    totalPower, ...
    vlfRelPower, ...
    lfRelPower, ...
    hfRelPower, ...
    lfNormalized, ...
    hfNormalized ...
);

freqHRVTable.Properties.VariableNames = { ...
    'VLF Peak Frequency (Hz)', ...
    'LF Peak Frequency (Hz)', ...
    'HF Peak Frequency (Hz)', ...
    'VLF Absolute Power (ms^2)', ...
    'LF Absolute Power (ms^2)', ...
    'HF Absolute Power (ms^2)', ...
    'Log Power VLF', ...
    'Log Power LF', ...
    'Log Power HF', ...
    'LF/HF Ratio', ...
    'Total Power (ms^2)', ...
    'VLF Relative Power (%)', ...
    'LF Relative Power (%)', ...
    'HF Relative Power (%)', ...
    'LF Normalized Power', ...
    'HF Normalized Power' ...
};

part = round(width(freqHRVTable) / 4);
freqHRVTable1 = freqHRVTable(:, 1:part);
freqHRVTable2 = freqHRVTable(:, part + 1:2 * part);
freqHRVTable3 = freqHRVTable(:, 2 * part + 1:3 * part);
freqHRVTable4 = freqHRVTable(:, 3 * part + 1:end);
disp(freqHRVTable1); %[output:864b9f30]
disp(freqHRVTable2); %[output:7b0ba4fb]
disp(freqHRVTable3); %[output:062b384b]
disp(freqHRVTable4); %[output:57931c3d]
% plot with powers
figure; %[output:18c1edc8]
plot(f, Pxx, 'r', 'LineWidth', 1.5);  %[output:18c1edc8]
hold on; %[output:18c1edc8]

% Shade VLF
fill([vlfFreqs; flipud(vlfFreqs)], ... %[output:18c1edc8]
     [vlfPower; zeros(size(vlfPower))], ... %[output:18c1edc8]
     [0.2 0.4 0.8], 'EdgeColor', 'none', 'FaceAlpha', 0.5); %[output:18c1edc8]

% Shade LF
fill([lfFreqs; flipud(lfFreqs)], ... %[output:18c1edc8]
     [lfPower; zeros(size(lfPower))], ... %[output:18c1edc8]
     [0.5 0.2 0.7], 'EdgeColor', 'none', 'FaceAlpha', 0.5); %[output:18c1edc8]

% Shade HF
fill([hfFreqs; flipud(hfFreqs)], ... %[output:18c1edc8]
     [hfPower; zeros(size(hfPower))], ... %[output:18c1edc8]
     [0.1 0.6 0.1], 'EdgeColor', 'none', 'FaceAlpha', 0.5); %[output:18c1edc8]

xlabel('Frequency (Hz)', 'FontSize', 14); %[output:18c1edc8]
ylabel('Power (ms^2/Hz)', 'FontSize', 14); %[output:18c1edc8]
title('HRV Frequency Domain Analysis', 'FontSize', 16); %[output:18c1edc8]
legend('PSD','VLF','LF','HF', 'FontSize', 12); %[output:18c1edc8]
grid on; %[output:18c1edc8]
hold off; %[output:18c1edc8]
% Plot Absolute Powers
powers = [vlfAbsPower, lfAbsPower, hfAbsPower];
bands = {'VLF', 'LF', 'HF'};

figure; %[output:57188762]
bar(powers, 'FaceColor', [0.2 0.6 0.8]);  %[output:57188762]
set(gca, 'XTickLabel', bands, 'FontSize', 12); %[output:57188762]
ylabel('Absolute Power (ms^2)', 'FontSize', 14); %[output:57188762]
title('HRV Frequency Domain - Absolute Powers', 'FontSize', 16); %[output:57188762]
grid on; %[output:57188762]

% Annotate bar values
for loopCount = 1:length(powers) %[output:group:98d88edc]
    text(loopCount, powers(loopCount) + 0.05 * max(powers), ... %[output:57188762]
        sprintf('%.2f', powers(loopCount)), ... %[output:57188762]
        'HorizontalAlignment', 'center', 'FontSize', 12); %[output:57188762]
end %[output:group:98d88edc]
% Data vectors for each power type
absPowers = [vlfAbsPower, lfAbsPower, hfAbsPower];
logPowers = [logVLF, logLF, logHF];
relPowers = [vlfRelPower, lfRelPower, hfRelPower];
normPowers = [NaN, lfNormalized, hfNormalized]; % no normalized VLF
totalPowers = [totalPower, NaN, NaN]; % total power applies to all

% X-axis labels
bands = {'VLF', 'LF', 'HF'};

figure; %[output:8d680d59]
hold on; %[output:8d680d59]

% Plot each measure
plot(1:3, absPowers, '-o', 'LineWidth', 1.5, 'DisplayName', 'Absolute Power'); %[output:8d680d59]
plot(1:3, logPowers, '-s', 'LineWidth', 1.5, 'DisplayName', 'Log Power'); %[output:8d680d59]
plot(1:3, relPowers, '-d', 'LineWidth', 1.5, 'DisplayName', 'Relative Power (%)'); %[output:8d680d59]
plot(1:3, normPowers, '-^', 'LineWidth', 1.5, 'DisplayName', 'Normalized Power (%)'); %[output:8d680d59]
plot(1:3, totalPowers, '-x', 'LineWidth', 1.5, 'DisplayName', 'Total Power'); %[output:8d680d59]

xticks(1:3); %[output:8d680d59]
xticklabels(bands); %[output:8d680d59]
xlabel('Frequency Band', 'FontSize', 14); %[output:8d680d59]
ylabel('Value', 'FontSize', 14); %[output:8d680d59]
title('HRV Power Measures by Band', 'FontSize', 16); %[output:8d680d59]
legend('Location','bestoutside'); %[output:8d680d59]
grid on; %[output:8d680d59]
hold off; %[output:8d680d59]
